import React from 'react'
import {PortfolioInfo} from '../../Info/PortfolioInfo'

const Portfolio = () => {
    return (
        <ul>
           {PortfolioInfo.map((item) => {
               return(
                   <h1>{item.title}</h1>
               )
           })};
        </ul>
    )
}

export default Portfolio
